import React, { useEffect, useState } from "react";
import "../css/Resume.css";
import { Document, Page, StyleSheet } from "react-pdf/dist/esm/entry.webpack";
import resume from "../assets/resume.pdf";
import $ from 'jquery';

function Resume() {

  useEffect(() => {
    $(".react-pdf__Page__canvas").prop({width: 200, height: 2000});
  });

  return (
    <div className="resume-wrapper">
      <div className="resume-background">Resume</div>
      <Document file={resume} className="resume-file">
        <Page pageNumber={1} />
      </Document>
    </div>
  );
}

export default Resume;
